import '../style/nav.css'
const Nav = () => {
    return ( 
        <div className="nav">
           <div className="logo">
            <img width={70} height={50} src="/images/logo.png" alt="" />
           </div>
           <div className="search">
            <input type="text" name="" id="" placeholder="Search"/>
           </div>
           <div className="options">
                <button>Add Video</button>
                <button>Sign in</button>
           </div>
        </div>
     );
}
 
export default Nav;
